description:
Verenigde Staten
Komedie / Familie
91 minuten

goed

met Roger Moore, Katie McGrath en Charlotte Salt

Het leven van Jules Day (Katie McGrath) staat volledig op zijn kop als ze noodgedwongen de zorg voor haar neefje Milo en 
nichtje Maddie op zich neemt. Nu, een jaar later, is haar leven nog steeds een chaos, maar is ze vastbesloten de kinderen een 
fijne kerst te bezorgen. Jules, Milo en Maddie reizen op uitnodiging van een uit het oog verloren familielid (Roger Moore) 
naar Europa, waar ze kerst zullen vieren op Castleburry Hall. Als Jules de charmante Prins Ashton ontmoet, wordt het verblijf 
op het kasteel een stuk leuker - tot ze zijn verloofde ontmoet en zich af begint te vragen of verschillen in afkomst ware 
liefde in de weg staan....
